define(function(){Math.dot=function(a,b){return Object.keys(a).reduce(function(d,e){return d+a[e]*b[e]},0)};Math.vxv=function(a,c){var b={};Object.keys(a).forEach(function(d){b[d]=a[d]*c[d]});return b};Math.vdv=function(a,c){var b={};Object.keys(a).forEach(function(d){b[d]=a[d]/c[d]});return b};Math.vpv=function(a,c){var b={};Object.keys(a).forEach(function(d){b[d]=a[d]+c[d]});return b};Math.vmv=function(a,c){var b={};Object.keys(a).forEach(function(d){b[d]=a[d]-c[d]});return b};Math.sxv=function(d,a){var b={};Object.keys(a).forEach(function(c){b[c]=a[c]*d});return b};Math.sdv=function(d,a){var b={};Object.keys(a).forEach(function(c){b[c]=a[c]/d});return b};Math.mxv=function(b,a){return b.map(function(c){return Math.dot(c,a)})};Math.cross2=function(a,b){return a.x*b.y-a.y*b.x};Math.norm=function(a){return Math.sqrt(Math.dot(a,a))};Math.normalize=function(a){return Math.sxv(1/Math.norm(a),a)};Math.med=function(c,b){var a={};Object.keys(c).forEach(function(d){a[d]=(c[d]+b[d])/2});return a};Math.rotate=function(f,e,c){var b=Math.degreeToRadians(e);c=c==undefined?{x:0,y:0}:c;var g=Math.cos(b);var d=Math.sin(b);var a=f.x-c.x;var h=f.y-c.y;return[(a*g-h*d)+c.x,(h*g+a*d)+c.y]};Math.degreeToRadians=function(a){return a*(Math.PI/180)};Math.degreeFromVec=function(b,a){var c=Math.radiansFromVec(b,a);return Math.radiansToDegree(c)};Math.radiansFromVec=function(e,d){var c=Math.dot(e,d);var b=Math.norm(e);var a=Math.norm(d);return Math.acos(c/(b*a))};Math.radiansToDegree=function(a){return a*(180/Math.PI)};Math.distance=function(b,a){return Math.sqrt(Object.keys(b).reduce(function(d,e){return d+Math.pow(b[e]-a[e],2)},0))};Math.clockWiseDegreeFromVec=function(b){var a={x:0,y:-1};var c=Math.degreeFromVec(b,a);if(b.x<0){c=360-c}return c};return Math});